from functools import lru_cache

def count_binary_strings_no_consecutive_ones(N: int) -> int:
    MOD = 10 ** 9 - 7

    @lru_cache(None)
    def recSol(n):
        if n == 1:
            return (1, 0, 0, 1)
        (a1, b1, c1, d1) = recSol(n // 2)
        (a2, b2, c2, d2) = recSol(n - n // 2)
        a3 = a1 * (a2 + c2) + b1 * a2
        b3 = a1 * (b2 + d2) + b1 * b2
        c3 = c1 * (a2 + c2) + d1 * a2
        d3 = c1 * (b2 + d2) + d1 * b2
        a3 %= MOD
        b3 %= MOD
        c3 %= MOD
        d3 %= MOD
        return (a3, b3, c3, d3)
    return sum(recSol(N)) % MOD

